by architects Borst and Hetherington, the house has many beautiful period elements representative of Old World craftmanship, which the owners realized could be seamlessly integrated into new world aesthetics and conveniences.  Working with a noted Chicago architect, the owners spent a year building an addition and carefully restoring the vintage features of the house.   Their first priority was to create a new kitchen, breakfast room and family room, where the family could cook and relax together. This space, the scale of which complements the rest of the main floor, features lighted Bulthaup cabinets, 35 feet of workable counter space in Scoon Extreme limestone and soapstone, full size separate Sub-Zero refrigerator and freezer, two Miele dishwashers, two warming trays, a Wolf double oven and 6 burner range, a pot filler, two appliance garages, a full size wine fridge and more than 60 drawers and cabinets.  Thoughtfully designed work spaces have easy access to the ingredients, utensils, cookware and appliances appropriate to the task at hand. The entire space is surrounded by windows and doors for seamless indoor/outdoor dining and entertaining. For more formal occasions, the owners use the adjoining oval-shaped dining room, which is graced with gorgeous leaded glass windows and an original built-in buffet.  To accommodate large casual gatherings, the owners excavated below the new kitchen to create a media room, one of several recreational rooms on the lower level, which also has a fully equipped gym.  Set off for privacy, the master bedroom suite occupies the west wing of the second floor.  It has a decorative fireplace, walk-in closet and spa-like bathroom with double steam shower, deep soaking tub, separate vanities and bidet.  There is also a large office cum sitting area on this level with a wet bar and fridge and access to a balcony that overlooks the professionally landscaped grounds.  At the east end of this floor, a bedroom and full bathroom with direct access to a rear staircase have served as guest quarters. The top floor has three exceptionally large bedrooms, laundry room, full bathroom and half bathroom. For a high performance house, the owners replaced the electrical and plumbing and created four smart HVAC zones with 2017 Lennox furnaces/central A/C for optimal comfort and control.  Built-in speakers supply the entire first floor and outside deck with music. The coach house has three heated parking spaces above which there is a renovated two bedroom apartment that has been continuously rented out.  A fourth parking space can be accessed separately. The grounds have been artfully landscaped with hardscape, irrigation systems and lighting, the final touch in creating a marvelous urban estate that melds the best of old and new.  To view video and floor plans, please see \\"Additional Information\\".","features":["Air Conditioning"],"images":[],"listing_agent":{"name":"Donna Schwan","phone":"","email":"donna@metroprorealty.com"},"mls_number":"MRD10771425","listing_date":null,"status":"New"},"match_score":0.1,"label":"Not Recommended","matched_features":["garage"],"dealbreaker_flags":[],"reason":"üè† Mixed bag on this one.\\nHas garage. But $3750K over budget and only 0 bedrooms. \\nü§î Could work if flexible.","score_breakdown":{"feature_match":8.333333333333332,"budget_match":0,"bedroom_match":7.5,"location_match":10,"visual_tag_match":5,"behavioral_tag_match":5,"listing_quality_score":3,"dealbreaker_penalty":0,"missing_data_penalty":-30,"visual_boost":0,"raw_total":8.833333333333329,"final_score":10}}]	[]	{"total_found":10,"top_picks_count":0,"other_matches_count":0,"visual_analysis_count":0,"search_criteria":{"id":10,"name":"Ranjan Dahal","email":"replytopiyush@gmail.com","budget":"$100K - $1M","budgetMin":100000,"budgetMax":1000000,"homeType":"single-family","bedrooms":2,"bathrooms":"1+","mustHaveFeatures":["garage","modern kitchen","good view of the lake"],"dealbreakers":["fixer-uppers"],"preferredAreas":[